pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./interfaces/ISwapManager.sol";
import "./interfaces/IWorkerWallet.sol";

contract SwapManager is ISwapManager, ReentrancyGuard {
    using SafeERC20 for IERC20;

    mapping(bytes32 => SwapOrder) public orders;
    mapping(bytes32 => bool) public usedSecrets;
    mapping(address => bool) public isWorkerWallet;

    address public immutable WETH;

    constructor(address weth) {
        WETH = weth;
    }

    receive() external payable {}

    function createOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable nonReentrant returns (bytes32) {
        require(amountIn > 0, "Zero amount");
        require(deadline > block.timestamp, "Invalid deadline");
        require(secretHash != bytes32(0), "Invalid secret hash");

        bytes32 orderId = keccak256(
            abi.encodePacked(
                msg.sender,
                block.timestamp,
                amountIn,
                tokenIn,
                tokenOut,
                secretHash
            )
        );

        require(orders[orderId].initiator == address(0), "Order exists");

        if (tokenIn == address(0)) {
            require(msg.value == amountIn, "Incorrect ETH amount");
        } else {
            IERC20(tokenIn).safeTransferFrom(msg.sender, address(this), amountIn);
        }

        orders[orderId] = SwapOrder({
            initiator: msg.sender,
            resolver: address(0),
            amountIn: amountIn,
            amountOutMin: amountOutMin,
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            deadline: deadline,
            secretHash: secretHash,
            isFulfilled: false,
            isRefunded: false
        });

        emit OrderCreated(
            orderId,
            msg.sender,
            tokenIn,
            tokenOut,
            amountIn,
            amountOutMin,
            secretHash
        );

        return orderId;
    }

    function registerWorkerWallet(address workerWallet) external override {
        require(!isWorkerWallet[workerWallet], "WorkerWallet already registered");
        isWorkerWallet[workerWallet] = true;
    }

    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable nonReentrant {
        SwapOrder storage order = orders[orderId];
        require(order.initiator != address(0), "Order not found");
        require(!order.isFulfilled, "Order already fulfilled");
        require(!order.isRefunded, "Order was refunded");
        require(block.timestamp <= order.deadline, "Order expired");
        require(keccak256(abi.encodePacked(secret)) == order.secretHash, "Invalid secret");
        require(!usedSecrets[secret], "Secret already used");
        require(amountOut >= order.amountOutMin, "Insufficient output amount");

        // If called by a worker wallet, verify it's the owner of the wallet
        if (isWorkerWallet[msg.sender]) {
            IWorkerWallet workerWallet = IWorkerWallet(msg.sender);
            require(workerWallet.owner() == tx.origin, "Not worker wallet owner");
        }

        order.isFulfilled = true;
        order.resolver = msg.sender;
        usedSecrets[secret] = true;

        // Transfer tokens to resolver
        if (order.tokenIn == address(0)) {
            // For native ETH, the amount should be in the contract
            require(address(this).balance >= order.amountIn, "Insufficient ETH balance");
            (bool success, ) = msg.sender.call{value: order.amountIn}("");
            require(success, "ETH transfer failed");
        } else {
            IERC20(order.tokenIn).safeTransfer(msg.sender, order.amountIn);
        }

        // Transfer output tokens from resolver to initiator
        if (order.tokenOut == address(0)) {
            require(msg.value >= amountOut, "Insufficient ETH sent");
            if (msg.value > amountOut) {
                payable(msg.sender).transfer(msg.value - amountOut);
            }
            payable(order.initiator).transfer(amountOut);
        } else {
            IERC20(order.tokenOut).safeTransferFrom(
                msg.sender,
                order.initiator,
                amountOut
            );
        }

        emit OrderFulfilled(orderId, msg.sender, secret);
    }

    function refundOrder(bytes32 orderId) external nonReentrant {
        SwapOrder storage order = orders[orderId];
        require(order.initiator != address(0), "Order not found");
        require(!order.isFulfilled, "Order already fulfilled");
        require(!order.isRefunded, "Already refunded");
        require(block.timestamp > order.deadline, "Deadline not reached");
        require(msg.sender == order.initiator, "Not order initiator");

        order.isRefunded = true;

        if (order.tokenIn == address(0)) {
            payable(order.initiator).transfer(order.amountIn);
        } else {
            IERC20(order.tokenIn).safeTransfer(order.initiator, order.amountIn);
        }

        emit OrderRefunded(orderId);
    }

    function getOrder(bytes32 orderId) external view returns (SwapOrder memory) {
        return orders[orderId];
    }
}
","keccak256":"0x9ec6a61483117ab2e3cfec4af083ad70a2ce769274f9694754cdd99c0ca5581e","license":"MIT"},"contracts/interfaces/ISwapManager.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface ISwapManager {
    struct SwapOrder {
        address initiator;
        address resolver;
        uint256 amountIn;
        uint256 amountOutMin;
        address tokenIn;
        address tokenOut;
        uint256 deadline;
        bytes32 secretHash;
        bool isFulfilled;
        bool isRefunded;
    }

    event OrderCreated(
        bytes32 indexed orderId,
        address indexed initiator,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        bytes32 secretHash
    );

    event OrderFulfilled(
        bytes32 indexed orderId,
        address indexed resolver,
        bytes32 secret
    );

    event OrderRefunded(bytes32 indexed orderId);

    function createOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable returns (bytes32);

    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable;

    function refundOrder(bytes32 orderId) external;

    function getOrder(bytes32 orderId) external view returns (SwapOrder memory);

    /**
     * @notice Register a worker wallet that can be used to fulfill orders
     * @param workerWallet The address of the worker wallet to register
     */
    function registerWorkerWallet(address workerWallet) external;
}
