pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./interfaces/IWorkerWallet.sol";
import "./interfaces/ISwapManager.sol";

contract WorkerWallet is IWorkerWallet {
    using SafeERC20 for IERC20;

    address public override owner;
    address public override swapManager;
    bool private initialized;

    modifier onlyOwner() {
        require(msg.sender == owner, "WorkerWallet: caller is not the owner");
        _;
    }

    modifier onlySwapManager() {
        require(msg.sender == swapManager, "WorkerWallet: caller is not the swap manager");
        _;
    }

    constructor(address _owner, address _swapManager) {
        require(_owner != address(0), "WorkerWallet: owner is zero address");
        require(_swapManager != address(0), "WorkerWallet: swap manager is zero address");

        owner = _owner;
        swapManager = _swapManager;
    }

    receive() external payable {}

    function execute(
        address target,
        uint256 value,
        bytes calldata data
    ) external override onlyOwner returns (bool success, bytes memory result) {
        (success, result) = target.call{value: value}(data);
        emit Executed(target, value, data, success);
    }

    function withdraw(address token, uint256 amount, address to) external override onlyOwner {
        require(to != address(0), "WorkerWallet: cannot withdraw to zero address");

        if (token == address(0)) {
            (bool success, ) = to.call{value: amount}("");
            require(success, "WorkerWallet: ETH transfer failed");
        } else {
            IERC20(token).safeTransfer(to, amount);
        }

        emit Withdrawn(token, amount, to);
    }
}
","keccak256":"0xaf66df7911357536efec01ed1da116c560499107b75b27e5910a116172b675e4","license":"MIT"},"contracts/interfaces/ISwapManager.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface ISwapManager {
    struct SwapOrder {
        address initiator;
        address resolver;
        uint256 amountIn;
        uint256 amountOutMin;
        address tokenIn;
        address tokenOut;
        uint256 deadline;
        bytes32 secretHash;
        bool isFulfilled;
        bool isRefunded;
    }

    event OrderCreated(
        bytes32 indexed orderId,
        address indexed initiator,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        bytes32 secretHash
    );

    event OrderFulfilled(
        bytes32 indexed orderId,
        address indexed resolver,
        bytes32 secret
    );

    event OrderRefunded(bytes32 indexed orderId);

    function createOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable returns (bytes32);

    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable;

    function refundOrder(bytes32 orderId) external;

    function getOrder(bytes32 orderId) external view returns (SwapOrder memory);

    /**
     * @notice Register a worker wallet that can be used to fulfill orders
     * @param workerWallet The address of the worker wallet to register
     */
    function registerWorkerWallet(address workerWallet) external;
}
