pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./interfaces/IWorkerWallet.sol";
import "./interfaces/ISwapManager.sol";

contract WorkerWallet is IWorkerWallet {
    using SafeERC20 for IERC20;

    address public override owner;
    address public override swapManager;
    bool private initialized;

    modifier onlyOwner() {
        require(msg.sender == owner, "WorkerWallet: caller is not the owner");
        _;
    }

    modifier onlySwapManager() {
        require(msg.sender == swapManager, "WorkerWallet: caller is not the swap manager");
        _;
    }

    constructor(address _owner, address _swapManager) {
        require(_owner != address(0), "WorkerWallet: owner is zero address");
        require(_swapManager != address(0), "WorkerWallet: swap manager is zero address");

        owner = _owner;
        swapManager = _swapManager;
    }

    receive() external payable {}

    function execute(
        address target,
        uint256 value,
        bytes calldata data
    ) external override onlyOwner returns (bool success, bytes memory result) {
        (success, result) = target.call{value: value}(data);
        emit Executed(target, value, data, success);
    }

    function withdraw(address token, uint256 amount, address to) external override onlyOwner {
        require(to != address(0), "WorkerWallet: cannot withdraw to zero address");

        if (token == address(0)) {
            (bool success, ) = to.call{value: amount}("");
            require(success, "WorkerWallet: ETH transfer failed");
        } else {
            IERC20(token).safeTransfer(to, amount);
        }

        emit Withdrawn(token, amount, to);
    }
}
","keccak256":"0xaf66df7911357536efec01ed1da116c560499107b75b27e5910a116172b675e4","license":"MIT"},"contracts/WorkerWalletFactory.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./WorkerWallet.sol";
import "./interfaces/ISwapManager.sol";

contract WorkerWalletFactory {
    event WorkerWalletCreated(address indexed owner, address wallet);

    mapping(address => address) public getWorkerWallet;
    mapping(address => bool) public isWorkerWallet;

    function createWorkerWallet(address _owner, address _swapManager) external returns (address workerWallet) {
        require(getWorkerWallet[_owner] == address(0), "WorkerWalletFactory: wallet already exists");

        // Get the creation code of WorkerWallet
        bytes memory bytecode = type(WorkerWallet).creationCode;

        // Encode constructor arguments
        bytes memory constructorArgs = abi.encode(_owner, _swapManager);

        // Create the init code with constructor arguments
        bytes memory initCode = abi.encodePacked(bytecode, constructorArgs);

        bytes32 salt = keccak256(abi.encodePacked(_owner, _swapManager, block.timestamp));

        assembly {
            workerWallet := create2(0, add(initCode, 0x20), mload(initCode), salt)
            if iszero(extcodesize(workerWallet)) {
                revert(0, 0)
            }
        }

        // Register the worker wallet
        getWorkerWallet[_owner] = workerWallet;
        isWorkerWallet[workerWallet] = true;

        // Register the worker wallet with the swap manager
        ISwapManager(_swapManager).registerWorkerWallet(workerWallet);

        emit WorkerWalletCreated(_owner, workerWallet);
    }

    function computeWorkerWalletAddress(address _owner, address _swapManager) public view returns (address) {
        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                keccak256(abi.encodePacked(_owner, _swapManager, block.timestamp)),
                keccak256(type(WorkerWallet).creationCode)
            )
        );
        return address(uint160(uint256(hash)));
    }
}
